    <div > 
        <Link to="/Login" ><span className='header_optionLionThree'>Sign In </span></Link>
        <Link to="/Login" ><span className='header_optionLionThree'>Sign In </span></Link>
        <Link to="/Signup" ><span className='header_optionLionThree'> / Sign Up</span></Link>
    </div>


